import '../css/exercise.css';
import Nav from './nav';
import BreathingExercise from './breathing';
import { useState, useEffect } from 'react';
import Tetris from 'react-tetris';


export default function Exercise() {
    return (
        <body>
            <Nav color = 'black' page = 'exercise' absolute = 'true' rIcon = 'black'/>
            <Exercise_main />
        </body>
    );
}

function Exercise_main (){

    useEffect(() => {
        document.body.style.overflow = 'auto';
      }, [])

    const [breathExe, setBreathExe] = useState(false);

    const handleBreathExe = () => {
        setBreathExe(true)
        document.body.style.overflow = 'hidden';
    }
    const handleBreathExeClose = () => {
        setBreathExe(false)
        document.body.style.overflow = 'auto';
    }

    return(
        <div>
            <div class="hero-exe">
                <div class="hero-cntxt-exe">
                    <h1>Breathing Exercise</h1>
                    <p>Revitalize your mind and body with our rejuvenating breathing exercise, designed to bring tranquility and focus into your daily life.</p>
                    <a class = "btn-mn" onClick={handleBreathExe}>Try me</a>
                </div>
                <div class="hero-img-exe">
                    <img src = "img/exercise.png" />
                </div>
            </div>


            <div class="exercise">
                <div class="h1">
                    <h1>Other assessments</h1>
                </div>
                <div class="container-exe">
                    <div class="wrapper-exe">
                        <h2>Assessment</h2>
                        <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Eius pariatur alias iusto ipsa inventore tempore.</p>
                    </div>
                    <div class="wrapper-exe">
                        <h2>Assessment</h2>
                        <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Eius pariatur alias iusto ipsa inventore tempore.</p>
                    </div>
                    <div class="wrapper-exe">
                        <h2>Assessment</h2>
                        <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Eius pariatur alias iusto ipsa inventore tempore.</p>
                    </div>
                </div>
            </div>

            <div style={{display: breathExe ? 'flex' : 'none'}}>
                <div className='close-btn-breathing' onClick={handleBreathExeClose}>
                    <ion-icon name="close"></ion-icon>
                </div>
                <BreathingExercise />
            </div>

            <div>
                <h1>Tetris</h1>
                <Tetris
                keyboardControls={{
                    // Default values shown here. These will be used if no
                    // `keyboardControls` prop is provided.
                    down: 'MOVE_DOWN',
                    left: 'MOVE_LEFT',
                    right: 'MOVE_RIGHT',
                    space: 'HARD_DROP',
                    z: 'FLIP_COUNTERCLOCKWISE',
                    x: 'FLIP_CLOCKWISE',
                    up: 'FLIP_CLOCKWISE',
                    p: 'TOGGLE_PAUSE',
                    c: 'HOLD',
                    shift: 'HOLD'
                }}
                >
                {({
                    HeldPiece,
                    Gameboard,
                    PieceQueue,
                    points,
                    linesCleared,
                    state,
                    controller
                }) => (
                    <div>
                    <HeldPiece />
                    <div>
                        <p>Points: {points}</p>
                        <p>Lines Cleared: {linesCleared}</p>
                    </div>
                    <Gameboard />
                    <PieceQueue />
                    {state === 'LOST' && (
                        <div>
                        <h2>Game Over</h2>
                        <button onClick={controller.restart}>New game</button>
                        </div>
                    )}
                    </div>
                )}
                </Tetris>
            </div>
        </div>
    );
}
